import React, { Component } from 'react';
import Select from 'react-select';
import axios from 'axios';

const initialState = {
    code:'',
    model:'',
    type:'',
    name:'',
    categories:[],
    options:[],
    selectedcategories:[]

}
class CreateVehicle extends  Component{
    constructor(props){
        super(props);
        this.onChange = this.onChange.bind(this);
        this.onCategorySelect =this.onCategorySelect.bind(this);
        this.onSubmit =this.onSubmit.bind(this);
        this.state = initialState;
    }
    componentDidMount(){
        axios.get('http://localhost:8055/category/')
        .then(response =>{
            this.setState({ categories: response.data.data}, () =>{
                // console.log('subjects',this.state.subjects)
                let data =[];
               this.state.categories.map((item, index) =>{
                   let category = {
                       value: item._id,
                    //    label:item.name
                    label:`${item.name} | Rs.${item.price}.00 PER HOUR`
                   }
                   data.push(category)
               });
               this.setState({ options: data });
            })
        })
    }
    onChange(e){
        this.setState({[e.target.name]:e.target.value})
    }
    onCategorySelect(e){
        this.setState({ selectedcategories:e ?e.map(item => item.value): []});
    }
    onSubmit(e){
        e.preventDefault();
        let vehicle ={
            code:this.state.code,
            model:this.state.model,
            type:this.state.type,
            name:this.state.name,
            categories:this.state.selectedcategories
        };
        console.log('DATA TO SEND',vehicle)
        axios.post('http://localhost:8055/vehicle/create', vehicle)
        .then(response => {
            alert("success!")
        })
        .catch(error =>{
            console.log(error.message);
            alert(error.message)
        })


    }
    render(){
        return(
            <div className= "container">
                <h1>Create cource</h1>
                <form onSubmit ={this.onSubmit}>
                    <div className="mb-3">
                        <label htmlFor="code" className="form-label">Code</label>
                        <input type="text" 
                        className="form-control"
                         id="code" 
                         name= "code" 
                         value = {this.state.code} 
                         onChange={this.onChange}
                         />
                    </div>
                    <div className="mb-3">
                        <label htmlFor="model" className="form-label">Model</label>
                        <input type="text" 
                        className="form-control"
                         id="model" 
                         name= "model" 
                         value = {this.state.model} 
                         onChange={this.onChange}
                         />
                    </div>
                    <div className="mb-3">
                        <label htmlFor="type" className="form-label">Type</label>
                        <input type="text"
                         className="form-control" 
                         id="type" 
                         name = "type" 
                         value={this.state.type}
                         onChange={this.onChange}
                          />
                    </div>
                    <div className="mb-3">
                        <label htmlFor="name" className="form-label">Name</label>
                        <input type="text"
                         className="form-control" 
                         id="name" 
                         name = "name" 
                         value={this.state.name}
                         onChange={this.onChange}
                        
                          />
                    </div>
                    <Select
                        options = {this.state.options}
                        onChange={this.onCategorySelect}
                        className="basic-multi-select"
                        isMulti
                    />


                    <button type="submit" className="btn btn-primary">Submit</button>
                </form>
            </div>
        )
    }
}
export default CreateVehicle;
